import { Component, OnInit } from '@angular/core';
import { NameSharingService } from '../../service/name-sharing.service';

@Component({
  selector: 'app-focus-room',
  templateUrl: './focus-room.component.html',
  styleUrls: ['./focus-room.component.css']
})
export class FocusRoomComponent implements OnInit{

  currentName: string = '';

  constructor(private nameService: NameSharingService) {}


  ngOnInit() {
    this.currentName = this.nameService.getCurrentName();
  }

}
